le=\"mso-bidi-font-weight:normal\">Máme tu začátek\r\ncyklistické sezony a s&nbsp;ním se blíží i cyklistického festival v&nbsp;ČR.\r\nAkce Prague Bike Fest 2025 proběhne 26. a 27. dubna na pražském Výstavišti. Tento\r\nfestival přinese nabitý program pro všechny milovníky cyklistiky, včetně\r\nadrenalinových exhibic, testování kol a závodů. Hlavním tahákem letošního\r\nročníku bude unikátní závod Big Air Eliminator, ve kterém se elitní jezdci\r\nutkají o prize money ve výši 100 000 Kč. Na akci opět nebude chybět ani náš\r\nstánek Cycli!</b></p>\r\n\r\n<p class=\"MsoNormal\">Tak jako všechny velké cyklistické akce v ČR, tak <b style=\"mso-bidi-font-weight:normal\">ani na Prague Bike Festu nebudeme chybět</b>.\r\nOpět <b style=\"mso-bidi-font-weight:normal\">nás zde najdete pod hlavičkou\r\nstánku Cycli</b>, v&nbsp;němž si budete moct prohlédnout prémiová italská kola\r\nOfficine Mattio. Krom nich si v&nbsp;našem stánku budete moci pořídit náš\r\nmerch. Navíc budete mít <b style=\"mso-bidi-font-weight:normal\">jedinečnou\r\nmožnost prohlédnout si naši zbrusu novou SJZ káru</b>. Rozhodné každého z&nbsp;Vás\r\nvšechny rádi uvidíme!</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Jedním z hlavních pilířů festivalu bude <b style=\"mso-bidi-font-weight:\r\nnormal\">cyklistický veletrh, který představí nejnovější vybavení</b>, trendy a\r\ntechnologické novinky. Návštěvníci si budou moct kola nejen prohlédnout, ale\r\ntaké přímo <b style=\"mso-bidi-font-weight:normal\">vyzkoušet na testovacích\r\nokruzích</b>. Součástí programu budou i organizované vyjížďky pod vedením\r\nprofesionálů, diskuse o bezpečnosti či cestovatelské přednášky.</p>\r\n\r\n<p class=\"MsoNormal\">Adrenalinoví nadšenci si přijdou na své při <b style=\"mso-bidi-font-weight:normal\">Big Air show, kde jezdci předvedou extrémní\r\ntriky ve výšce až 7 metrů nad zemí</b>. Stejně jako loni se můžete těšit na\r\nTeodora Kováče, který společně s dalšími špičkovými jezdci předvede triky jako\r\ndouble-backflip. Festival nabídne také závod Fixed Gear na uzavřené trati či\r\nTrial zónu.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Na své si přijdou i rodiny s&nbsp;dětmi, které se mohou těšit\r\nna <b style=\"mso-bidi-font-weight:normal\">speciální dětskou zónu od Trail Guide</b>,\r\nkde si nejmenší cyklisté pod dohledem instruktorů vyzkouší různé překážky a\r\nzlepší svou techniku jízdy. Za splnění všech úkolů získají <b style=\"mso-bidi-font-weight:\r\nnormal\">malí cyklisté odměnu a budou se moci zapojit do soutěže o věcné ceny</b>.</p>\r\n\r\n<p class=\"MsoNormal\">Doprovodný program nabídne kromě cyklistických <b style=\"mso-bidi-font-weight:normal\">aktivit i relaxaci a zábavu u pódia</b>,\r\nkteré bude nedaleko Křižíkovy fontány. Zde budou probíhat <b style=\"mso-bidi-font-weight:\r\nnormal\">různé diskuze, besedy, cestovatelské přednášky a ukázky zdravého\r\nživotního stylu</b>. Chybět nebudou ani stánky s občerstvením, kde si\r\nnávštěvníci mohou vychutnat pestrou nabídku jídla a pití.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Festival Prague Bike\r\nFest je určen nejen profesionálním jezdcům, ale i rekreačním cyklistům a široké\r\nveřejnosti</b>. Vstup na něj si již teď můžete zakoupit za 100 – 580Kč. Akci\r\norganizuje Výstaviště Praha ve spolupráci s firmou MVP s.r.o. <b style=\"mso-bidi-font-weight:normal\">Hlavním partnerem je společnost Sazka</b>, dalšími\r\npartnery jsou Škoda Auto, Pražská plynárenská, LIDL a Foodora.</p>\r\n\r\n<p class=\"MsoNormal\">Vstupenky na akci si můžete zakoupit <a href=\"https://goout.net/cs/prague-bike-fest-2025/szytwnx/\" target=\"_blank\"><b>ZDE</b></a><b style=\"mso-bidi-font-weight:\r\nnormal\"></b></p>\r\n\r\n    ', 6, 'tuhle-cyklistickou-akci-pro-verejnost-si-nesmis-nechat-ujit-prague-bike-fest-2025-za-rohem');